%other constants
CM_MIN = -8;
CM_MAX = 8;

% order for median filter smooth
ORDER_MEDFILTER = 3; %

DEGREE_PER_LED_SLOT = 360 / 96;  % fixed from YEF math error on 1/3/18
MIDLINE_POSITION = 34;%28; % LED position where the fly is aligned to for all 230 deg EPG recordings 11/2017  - present
POSSIBLE_BAR_LOCATIONS = 2:2:70;
barPositionDegreesFromMidline = ( POSSIBLE_BAR_LOCATIONS - MIDLINE_POSITION ) * DEGREE_PER_LED_SLOT;
%% Plot the heat map for whole data set
figure('Position',[50, 50, 1000, 400]);
set(gcf, 'Color', 'w');
SORT_BY_MIN = 0; % if false defaults to max excitation ordering


rfResponseFiltered = medfilt1( rfResponsePeriod(:,:), ORDER_MEDFILTER, 'truncate',2); % Median filtering of the trace
rfPostFiltered = medfilt1( rfPostPeriod(:,:), ORDER_MEDFILTER, 'truncate',2); % Median filtering of the trace

if( SORT_BY_MIN )
    % reorder OL tuning based on location of min resposne per row
    [responseAmpIndex,  index] = min( rfResponseFiltered ,[],2);
    
    % find index for post period to be used in histgram later
    [ ~ ,  postIndex] = min( rfPostFiltered ,[],2);
else
    % reorder OL tuning based on location of min resposne per row
    [~,  index] = max( rfResponseFiltered ,[],2);
    [~, postIndex] = max( rfPostFiltered ,[],2);
end
[~, sortIndex ] = sort( index );

rfResponseFilteredAndSorted = rfResponseFiltered(sortIndex, :);
rfPostFilteredAndSorted = rfPostFiltered(sortIndex, :);

% plot the response heat map
subplot( 1, 2, 1)

imagesc( rfResponseFilteredAndSorted ); hold on;
set(gca,'color',0*[1 1 1]); 

c = colorbar;
c.Label.String = '\DeltaVm  (mV)';
caxis( [ CM_MIN , CM_MAX]);

colormap('bluewhitered'); % zero set to white in this plotting

set(gca, 'xtick', 1: length(barPositionDegreesFromMidline) );
labels = round(barPositionDegreesFromMidline) ;
set(gca, 'xticklabel', labels );

ylabel( ' cell ' );
xlabel(' bar position (deg)')
title( ' during bar period ')
niceaxes; 
box off;

% plot the post period heat map
subplot( 1, 2, 2)
imagesc( rfPostFilteredAndSorted ); hold on;
set(gca,'color',0*[1 1 1]); 

c = colorbar;
c.Label.String = '\DeltaVm  (mV)';
caxis( [ CM_MIN , CM_MAX]);

colormap('bluewhitered'); % zero set to white in this plotting

set(gca, 'xtick', 1: length(barPositionDegreesFromMidline) );
labels = round(barPositionDegreesFromMidline) ;
set(gca, 'xticklabel', labels );

ylabel( ' cell ' );
xlabel(' bar position (deg)')
title( ' post bar period ')
niceaxes; 
box off;

%% plot histogram of peak inhbition
figure;
set(gcf, 'Color', 'w');
subplot( 2, 2, 1)
histogram( index , length(barPositionDegreesFromMidline) );
set(gca, 'xtick', 1: length(barPositionDegreesFromMidline) );
labels = round(barPositionDegreesFromMidline) ;
set(gca, 'xticklabel', labels );
title('during bar period')
ylim([ 0 10]);
box off; % niceaxes;


subplot( 2, 2, 2)
histogram( postIndex , length(barPositionDegreesFromMidline) );
set(gca, 'xtick', 1: length(barPositionDegreesFromMidline) );
labels = round(barPositionDegreesFromMidline) ;
set(gca, 'xticklabel', labels );
title( ' post bar period');
ylim([ 0 10]);
box off; niceaxes;

% Plot average receptive field across whole population (mv)
subplot(2, 2, 3)
plot( barPositionDegreesFromMidline, mean( rfResponseFilteredAndSorted, 1 ) );
ylabel( 'mV'); xlim([ -120, 135]);
ylim([ -1.7 0.25]);
title('during bar period'); box off; niceaxes;

subplot(2, 2, 4)
plot( barPositionDegreesFromMidline, mean( rfPostFilteredAndSorted, 1 ) );
ylabel( 'mV'); xlim([ -120, 135]);
ylim([ -1.7 0.25]);
title('post bar period'); box off; niceaxes;

